{"phase": "description", "counterbalance": 6, "vidpath": "/static/video/G/filmfest_clip8_G_5.mp4", "descstop": 3, "vidpair": 6, "offset": "280", "content": "A digger turns up at the beach and starts loading up a lorry with the rock, other rocks and sand. The rock is driven to a factory where it is dumped onto a conveyor belt and is then thrown into a boiling hot melting pot.

