{"phase": "description", "counterbalance": 6, "vidpath": "/static/video/G/filmfest_clip8_G_1.mp4", "descstop": 1, "vidpair": 2, "offset": "100", "content": "The rock left the village and found a cozy place to sleep. While he slept, a villager caught the rock with a lasso and brought the rock to his village.

